    def searchClick(self):
        model_number = self.partNumberSearch.text()
        path = get_Path(model_number)
        if model_number:
            #version_control(1.1)
            try:
                #openPath(path)
                arr = extensive_Lookup(path, model_number, "True")
                print(arr[0])
                cons = arr[0]
                molds = arr[1]
                wires = arr[2]
                if cons:
                    try:
                        self.Con1.setPlainText(str(cons[0]))
                        self.Con2.setPlainText(str(cons[1]))
                        self.Con3.setPlainText(str(cons[2]))
                        self.Con4.setPlainText(str(cons[3]))
                    except IndexError:
                        print("YOU BROKE IT")
                if molds:
                    try:
                        self.Mold1.setPlainText(str(molds[0]))
                        self.Mold2.setPlainText(str(molds[1]))
                        self.Mold3.setPlainText(str(molds[2]))
                        self.Mold4.setPlainText(str(molds[3]))
                    except IndexError:
                        print("YOU BROKE IT")
                if wires:
                    try:
                        self.Wire1.setPlainText(str(wires[0]))
                        self.Wire2.setPlainText(str(wires[1]))
                        self.Wire3.setPlainText(str(wires[2]))
                        self.Wire4.setPlainText(str(wires[3]))
                    except IndexError:
                        print("YOU BROKE IT")
            except(TypeError, OSError, FileNotFoundError):
                #create_logs(f"TypeError {path} {datetime.datetime.now().strftime('%d-%m-%Y %H:%M:%S')}")
                print('Failed to open path')








